PoEResItem *   GetItemResource(std::wstring szItemPath)
{
	int i = 0;

	for (i = 0; i < ITEM_RES_COUNT; i++)
	{
		if (!wcscmp(g_pResItem[i].szPath,szItemPath.c_str()))
		{
			return &g_pResItem[i];
		}
	}

	return NULL;
}
